import React from "react";
import { ThemeProvider as MuithemeProvider } from "@material-ui/core/styles";
import theme from "./theme/theme";
import PerfilUsuario from "./componentes/seguridad/PerfilUsuario";
import Login from "./componentes/seguridad/Login";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import RegistrarUsuario from "./componentes/seguridad/RegistrarUsuario";
import { Grid } from "@material-ui/core";

function App() {
  return (
    //Posterior configuramos el react-router-dom q me permite la comunicacion entre diferentes comp react

    <Router>
      {/*El param q va ingresar sera {theme} q definimos anteriromnt*/}
      <MuithemeProvider theme={theme}>
        <Grid container>
          <Switch>
            <Route exact path="/auth/login" component={Login} />
            <Route exact path="/auth/registrar" component={RegistrarUsuario} />
            <Route exact path="/auth/perfil" component={PerfilUsuario} />
          </Switch>
        </Grid>
      </MuithemeProvider>
    </Router>
  );
}

export default App;
